import React, { Component } from 'react';

class App extends Component {
  getChckebox(event) {
    const value = event.target.value;
}

  render() {
    const data = [{ name: 'raju', age: 23 }, { name: 'ramu', age: 26 }, { name: 'ravan', age: 25 }, { name: 'laxman', age: 30 }]
    return (
      <div>
        <ul>
          {data.map(item => {
            return <li>{item.name}-{item.age}</li>;
          })}
        </ul>
        <input onClick={this.getChckebox.bind(this)} type="checkbox" value="Text" />
      </div>
    );
  }
}

export default App;
